import React, { Component } from 'react';
import Head from 'next/head';

// Data
import learnCards from '../data/learn';

class LearningCards extends Component {
    
    constructor(props) {
        super(props);
        this.state = {
            learnCardRenderer: ''
        }
    }

    componentDidMount() {
        this.setLearnCards();
    }

    setLearnCards=()=> {
        this.setState({learnCardRenderer: learnCards});
    }

    getLearnCards=()=> {
        if(this.state.learnCardRenderer) {
            console.log("Learn Rendere:", this.state.learnCardRenderer);
        }
    }

    render() {
       console.log("State: ", this.state.learnCardRenderer && this.state.learnCardRenderer);
        return (
            <div>
                <Head>
                    <link href="/static/style.css" rel="stylesheet" />
                </Head>
                <div className="threecolumns container">
                    {this.getLearnCards}
                    <div className="col">
                        <div className="img">
                            <img src="/img01.jpg" alt="Image description" />
                            <h2>Elevate</h2>
                        </div>
                        <p>Ready to Elevate your practice with Aesthetic Record software?</p>
                        <a href="#" className="btn">Elevate Now </a>
                    </div>
                    <div className="col">
                        <div className="img">
                            <img src="img02.jpg" alt="Image description" />
                            <h2>Tutorials</h2>
                        </div>
                        <p>Want to learn more about a particular feature or need a quick Tutorial?</p>
                        <a href="#" className="btn">Learn More  </a>
                    </div>
                    <div className="col">
                        <div className="img">
                            <img src="img03.jpg" alt="Image description" />
                            <h2>Academy</h2>
                        </div>
                        <p>Want our experts to show you all that our system can offer?</p>
                        <a href="#" className="btn">Attend Here</a>
                    </div>
                </div>
            </div>
        );
    }
}

export default LearningCards;
